import { createApp } from 'vue';
import { createRouter } from 'vue-router';
import App from './App.vue';


import LoginComponent from './pages/Login/LoginComponent';

const routes = [
    {path: '/', component: LoginComponent}
]

createApp(App).mount("#app")
